{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"cell_type":"markdown","source":"# Bella beat caso práctico\n---\ntitle: 'Caso Práctico Bellabeat'\nauthor: 'Jesús Alvarado'\ndate: 'r Sys.Date()'\noutput: html_document\n---","metadata":{"_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","_execution_state":"idle"}},{"cell_type":"markdown","source":"## **ACERCA DE LA EMPRESA**\n\nBellabeat, la empresa fundada por Urška Sršen y Sando Mur, se destaca por sus productos de alta tecnología enfocados en la salud. Utilizando la experiencia artística de Sršen, la compañía ha creado tecnología elegante que brinda información e inspiración a mujeres en todo el mundo. La recopilación de datos sobre actividad física, sueño, estrés y salud reproductiva ha permitido a Bellabeat empoderar a las mujeres con conocimientos sobre su bienestar. Desde su inicio en 2013, la empresa ha crecido rápidamente, estableciéndose como líder en tecnología para el bienestar de la mujer. Ha encomendado al equipo de análisis computacional de datos explorar patrones de uso de dispositivos inteligentes, buscando nuevas perspectivas que guíen la estrategia de marketing de Bellabeat.","metadata":{}},{"cell_type":"markdown","source":"## **PREGUNTAR**\n\n**Tareas clave**\n\n1. La tarea empresarial es analizar los datos de uso de dispositivos inteligentes de Bellabeat para comprender cómo las personas están utilizando sus productos y extraer información relevante para mejorar la estrategia de marketing y el desarrollo de productos.\n2. Interesados clave: Urška Sršen y Sando Mur (Fundadores de Bellabeat): Como fundadores, están interesados en obtener información que guíe la dirección futura de la empresa y contribuya a su crecimiento.\n3. El objetivo es obtener una comprensión profunda de los patrones de uso de los dispositivos inteligentes de Bellabeat. Esto implica identificar las características más utilizadas de los productos, los momentos de mayor actividad, las tendencias estacionales y cualquier otro patrón significativo. Al analizar estos datos, se busca obtener información que permita mejorar la oferta de productos y adaptar las estrategias de marketing para satisfacer mejor las necesidades y deseos de los clientes.","metadata":{}},{"cell_type":"markdown","source":"## **PREPARAR**\n\n* **¿Dónde se almacenan tus datos?**\nLos datos de seguimiento de actividad física de Fitbit se encuentran disponibles en un conjunto de datos en Kaggle, accesible a través de Mobius.\n\n* **¿Cómo están organizados los datos? ¿Están en formato largo o ancho?**\nLos datos probablemente estén organizados en un formato largo, donde cada fila representa una observación individual con varias columnas que contienen información específica sobre esa observación, como el rendimiento de la actividad física en minutos, ritmo cardíaco y monitoreo del sueño.\n\n* **¿Hay problemas con el sesgo o la credibilidad de estos datos? ¿Tus datos son confiables, originales, integrales, actuales y citados (ROCCC)?**\nLos datos pueden tener cierto sesgo si los usuarios de Fitbit representan un grupo específico de la población. Es importante verificar la credibilidad y originalidad de los datos, asegurando que provengan de fuentes confiables y estén debidamente citados. Además, evaluar la integridad de los datos es esencial para garantizar que sean completos y actuales.\n\n* **¿Cómo estás abordando la autorización, la privacidad, la seguridad y la accesibilidad?**\nEs necesario asegurarse de que los datos se hayan obtenido de manera ética y legal, respetando la privacidad y la autorización de los usuarios. También es fundamental garantizar la seguridad de los datos durante su manipulación y análisis. Además, asegurarse de que los datos sean accesibles y comprensibles para aquellos que trabajen con ellos.\n\n* **¿Cómo verificaste la integridad de los datos?**\nRealizar un proceso de control de calidad, como identificar y manejar valores atípicos o faltantes, es crucial para asegurar la integridad de los datos. La validación cruzada con fuentes confiables también puede ayudar a verificar la precisión de los datos.\n\n* **¿De qué manera te ayuda a responder tu pregunta?**\nEl conjunto de datos permite explorar los hábitos de los usuarios de dispositivos Fitbit, proporcionando información sobre su actividad diaria, pasos, ritmo cardíaco y monitoreo del sueño. Estos datos ayudarán a comprender cómo los usuarios están utilizando los productos de Bellabeat y cómo podrían adaptarse mejor a sus necesidades.\n\n* **¿Existe algún problema con los datos?**\nPodrían existir problemas de calidad de datos, como valores atípicos, inconsistencias o faltantes. Además, la representatividad de los usuarios de Fitbit en relación con la población en general podría ser un problema a considerar para inferir conclusiones más amplias. ","metadata":{}},{"cell_type":"markdown","source":"**INSTALAR Y CARGAR PAQUETES**","metadata":{"execution":{"iopub.status.busy":"2023-08-28T17:46:00.886785Z","iopub.execute_input":"2023-08-28T17:46:00.916772Z","iopub.status.idle":"2023-08-28T17:46:00.943362Z"}}},{"cell_type":"code","source":"install.packages('tidyverse')\ninstall.packages('ggplot2')","metadata":{"execution":{"iopub.status.busy":"2023-08-29T17:01:40.909387Z","iopub.execute_input":"2023-08-29T17:01:40.911270Z","iopub.status.idle":"2023-08-29T17:02:25.274725Z"},"trusted":true},"execution_count":10,"outputs":[{"name":"stderr","text":"Installing package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\nInstalling package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\n","output_type":"stream"}]},{"cell_type":"code","source":"library(tidyverse)","metadata":{"execution":{"iopub.status.busy":"2023-08-29T17:02:33.895366Z","iopub.execute_input":"2023-08-29T17:02:33.8