ORK5CYII="},"metadata":{"image/png":{"width":420,"height":420}}}]},{"cell_type":"markdown","source":"-\tSteps peaked between 12:00-14:00 and 17:00- 19:00, and intensity was the highest between 17:00-19:00\n-\tIt would be good to send notifications to introduce new workouts and/or high intensity workouts between 12:00-14:00 and 17:00- 19:00 where users are more likely to exercise\n-\tHourly reminder can also be sent to remind users to move around and take more steps in the morning (8:00-12:00) and in the evening (20:00- 22:00) where step counts are lower","metadata":{}},{"cell_type":"markdown","source":"Next, take a look at the average steps taken over the days in a week for 33 subjects","metadata":{}},{"cell_type":"code","source":"daily_activity_steps <- daily_activity %>%\n  mutate(weekday = weekdays(date)) %>%\n  arrange(weekday) %>%\n  mutate(weekday = ordered(weekday, levels = c(\"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \"Saturday\", \"Sunday\"))) %>%\n  group_by(weekday) %>%\n  summarize(average_steps = mean(TotalSteps))\n\nggplot(data = daily_activity_steps)+\n  geom_bar(mapping=aes(x = weekday, y = average_steps), stat = \"identity\")+\n  labs(title=\"average steps per week\", x=\" \", y=\"average_steps\")+\n  theme(axis.text.x = element_text(angle=90))","metadata":{"execution":{"iopub.status.busy":"2023-08-29T17:10:57.361717Z","iopub.execute_input":"2023-08-29T17:10:57.364511Z","iopub.status.idle":"2023-08-29T17:10:58.299611Z"},"trusted":true},"execution_count":32,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdeZxd893A8d+dubNkZpLJShZBNrIgaC1BRJSSUnuLtojW0oqmIbZStaUUlRJb\nlKK1t0UtjdZWoWKPx04QBEFIZJlkJrPd549hRGTGmZtMrvnl/f7jeeWcc8+93/ndPPLpucuk\nMplMAACg7cvL9QAAAKwawg4AIBLCDgAgEsIOACASwg4AIBLCDgAgEsIOACASwg4AIBLCDnLv\nmg27pFKpGz9ekutBAGjbhB0hhJCpX/zoo48+8fS7uR4EAMiesCOEEGorZ2y33Xbf3ffKXA8C\nAGRP2AEARELYtabM0jk19bkeYjWpr66qy7SFe16TnhQA1jR