el día y reducir su tiempo de inactividad.\n\n**Informar sobre segmentos de clientes:**\nEsta relación podría ayudar a Bellabeat a segmentar su base de clientes en diferentes grupos y adaptar su estrategia de marketing en consecuencia.\n\n**a. Usuarios que buscan comenzar a caminar más:** Bellabeat podría enfocarse en los usuarios que tienen un alto número de minutos sedentarios pero pocos pasos dados. Promocionar sus productos como una forma de motivar a las personas a moverse más y reducir su tiempo de inactividad podría ser un enfoque efectivo.\n\n**b. Usuarios que buscan medir sus pasos actuales:** Por otro lado, Bellabeat también podría dirigirse a usuarios que ya están activos y buscan medir y rastrear los pasos que ya están dando. Resaltar cómo sus dispositivos pueden proporcionar una medida precisa y útil de su actividad física diaria podría ser atractivo.\n\n**Mensajes de marketing:**\nPara el primer grupo de usuarios, Bellabeat podría enfocar su mensaje en la importancia de romper el ciclo de inactividad y presentar sus productos como herramientas motivadoras para comenzar a caminar más y mejorar su salud. Para el segundo grupo, podría enfatizar la precisión de sus dispositivos en el seguimiento de pasos y presentarlos como aliados en el mantenimiento de un estilo de vida activo.","metadata":{}},{"cell_type":"markdown","source":"## Validar la correlacion con TotalSteps vs Calories","metadata":{}},{"cell_type":"code","source":"ggplot(data=daily_activity)+\ngeom_smooth(mapping=aes(x=TotalSteps, y=Calories))+\ngeom_point(mapping=aes(x=TotalSteps, y=Calories))+\nlabs(title=\"Total steps vs calories\")","metadata":{"execution":{"iopub.status.busy":"2023-08-29T17:11:25.645561Z","iopub.execute_input":"2023-08-29T17:11:25.648482Z","iopub.status.idle":"2023-08-29T17:11:28.273835Z"},"trusted":true},"execution_count":34,"outputs":[{"name":"stderr","text":"\u001b[1m\u001b[22m`geom_smooth()` using method = 'loess' and formula = 'y ~ x'\n","output_type":"stream"},{"outp